import React, { useState } from 'react';
import Axios from 'axios';
class ApplicantForm extends React.Component
{

    constructor(props)
    {
        super(props);
        this.url="http://127.0.0.1:8000/api/apply/";
        this.data={
            Name:"",
    FName:"Sar",
    Gender:"Male",
    DOB:"2002-04-04",
    Age:"18",
    Category:"ABC",
    Ward:"EKV",
    SubDistrict:"Erode",
    District:"Erode",
    State:"Tamilnadu",

    Pincode:"123456", 

    Mobile:"9087654321",
    AadharNo:"123456789012",
    Disablity:"No",
    DisabilityType:"None",
    BPL_Family_ID:"ded",
    BankDetails:"Nothin",
    IGNOAPS:"Yes",
    IGNWPS:"Yes",
    IGNDPS:"Yes",
    NFBS:"Yes"
        }
    }



    handleSubmit(e)
    {
        e.preventDefault();
        console.log(this.data.Name);
        console.log(this.data.FName);
        console.log(this.data);
        // Axios.post(this.url,this.data).then(res=>{
        //     console.log(res.data);
        // })
    }
    handleChange(event) {
        this.setState({value: event.target.value});
      }

    // function handle(e)
    // {
    //   const newdata=(...data)=>
    //   newdata[e.target.id]=e.target.value
    //   setData(newdata)
    //   console.log(newdata)
    // }
    render(){
        return(
        <div>
          <form onSubmit={this.handleSubmit}>
                <input  onChange={this.handleChange} id="Name" value={this.data.Name} placeholder='Name' type="text"></input>
                <input onChange={this.handleChange} id="Fname" value={this.data.FName} placeholder='Fname' type='text'></input>
                <input onChange={this.handleChange} id="Gender" value={this.data.Gender} placeholder='Gender' type='text'></input>
                <input onChange={this.handleChange} id="DOB'" value={this.data.DOB} placeholder='DOB' type='text'></input>
                <input onChange={this.handleChange} id="Age" value={this.data.Age} placeholder='Age' type='number'></input>
                <input onChange={this.handleChange} id="Category" value={this.data.Category} placeholder='Category' type='text'></input>
                <input onChange={this.handleChange} id="Ward" value={this.data.Ward} placeholder='Ward' type='text'></input>
                <input onChange={this.handleChange} id="SubDistrict" value={this.data.SubDistrict} placeholder='SubDistrict' type='text'></input>
                <input onChange={this.handleChange} id="District" value={this.data.District} placeholder='District' type='text'></input>
                <input onChange={this.handleChange} id="State" value={this.data.State} placeholder='State' type='text'></input>
                <input onChange={this.handleChange} id="Pincode" value={this.data.Pincode} placeholder='Pincode' type='number'></input>
                <input onChange={this.handleChange} id="Mobile" value={this.data.Mobile} placeholder='Mobile' type='number'></input>
                <input onChange={this.handleChange} id="AadharNo" value={this.data.AadharNo} placeholder='AadharNo' type='number'></input>
                <input onChange={this.handleChange} id="Disability" value={this.data.Disablity} placeholder='Disability' type='text'></input>
                <input onChange={this.handleChange} id="DisabilityType" value={this.data.DisabilityType} placeholder='DisabilityType' type='text'></input>
                <input onChange={this.handleChange} id="BPL_Family_ID" value={this.data.BPL_Family_ID} placeholder='BPL_Family_ID' type='text'></input>
                <input onChange={this.handleChange} id="BankDetails" value={this.data.BankDetails} placeholder='BankDetails' type='text'></input>
                <input onChange={this.handleChange} id="IGNOAPS" value={this.data.IGNOAPS} placeholder='IGNOAPS' type='text'></input>
                <input onChange={this.handleChange} id="IGNWPS" value={this.data.IGNWPS} placeholder='IGNWPS' type='text'></input>
                <input onChange={this.handleChange} id="IGNDPS" value={this.data.IGNDPS} placeholder='IGNDPS' type='text'></input>
                <input onChange={this.handleChange} id="NFBS" value={this.data.NFBS} placeholder='NFBS' type='text'></input>
                <input type="submit" value="Submit" />

          </form>





    </div>);
    };

}
export default ApplicantForm;
